@Test
    public void testOneNull() {
        IDifference result = AtomTypeHybridizationDifference.construct("Foo", null, IAtomType.Hybridization.SP1);
        Assert.assertNotNull(result);

        result = AtomTypeHybridizationDifference.construct("Foo", IAtomType.Hybridization.SP1, null);
        Assert.assertNotNull(result);
    }

focal_method.body:
public static IDifference construct(String name, IAtomType.Hybridization first, IAtomType.Hybridization second) {
        if (first == second) {
            return null;
        }
        return new AtomTypeHybridizationDifference(name, first, second);
    }
